import styled from "styled-components";
import { Avatar, TextDetail } from "../../container/style";
import History from "./History";

const Profile = () => {
	return (
		<>
			<LayoutProfile>
				<Profiles>
					{/* <AvatarProfile /> */}
					<ProfileDetails>
						<ProfileText>
							<TextDetail>
							<AvatarProfile />
							<div style={{margin:'auto'}}>
									<p>Name</p>
							<p>Username</p>

							</div>

						</TextDetail>
						</ProfileText>
						<ProfileText>
						</ProfileText>

						<History/>

					</ProfileDetails>
				</Profiles>
			</LayoutProfile>
		</>
	);
};
export default Profile;

const ProfileText = styled.div`
	margin: 50px 100px;
`;
const LayoutProfile = styled.div`
	padding-top: 50px;
	/* background-color: red; */
`;
const Profiles = styled.div`
	display: flex;
	flex-wrap: wrap;
	justify-content: center;
	/* background-color: gainsboro; */
	width: 70%;
	margin: auto;
`;
const AvatarProfile = styled.div`
	background-color: green;
	width: 12vw;
	z-index: 1;
	border-radius: 100px;
	height: 12vw;
`;
const ProfileDetails = styled.div`
	background-color: yellow;
	border-radius: 50px;
	width: 100%;
	/* transform: translateY(-100px); */
`;
